import React from 'react';

const Modal = () => {
    const setIsModalOpened = useState(true);

    const closemodal = () => {
        setIsModalOpened(false);
    };
    return (
        <div className="modal">
            <div className="modal-content">
            <p>Modal</p>
            <span closeModal={closemodal}>x</span>
            </div>
        </div>
    );
};

Modal.propTypes = {
    closemodal: PropTypes.func
};

export default Modal;
